import React from 'react';
import Button from 'react-bootstrap/Button';
import './history.scss';


class History extends React.Component {
  constructor(props) {
    super(props);
    // this.handleUrl = this.handleUrl.bind(this);
  }
  getValues = (e) => {
    let request = e.target.innerHTML;
    request = request.split(', ');
    console.log(request);
    this.props.handleUrl(request[1]);
    this.props.handleRoute(request[0]);
    this.props.handleBody(request[2]);
    this.props.handleHistory(request);
  }
  render() {
    return (
      <div>
        <h3>History</h3>
        <section className="history">
          <ul>
          {Object.keys(sessionStorage).map((i, val) => {
            return (
              <>
              <li key={i} onClick={this.getValues}>{sessionStorage.getItem(i, val)}
              </li>
              <Button type="submit" size="sm" className="submit-btn bg-danger text-light" variant="secondary"></Button>

              </>
            );
          })}
          </ul>
        </section>
      </div>
    )
  }
}

export default History;
